(1, 'Mainan Mobil Remote Control Off-Road Climbing Car 2WD Powerful', 'https://images.tokopedia.net/img/cache/200-square/VqbcmM/2024/1/22/8020d5ad-6932-4a16-be41-17410c4e874c.jpg', 'Rp.110.000', 'Mobil remote control populer, tubuh terbuat dari paduan, ban karet anti selip, cocok untuk berbagai medan seperti pegunungan, pasir, rumput. Casingnya memiliki cat semprot yang halus dan indah yang terlihat sangat keren!\r\n\r\n\r\nParameter produk:\r\n------Model 770 & Model L6------\r\n- Scale 1:20\r\n- Double Motor Engine\r\n- Ban karet\r\n- Dapat bergerak maju mundur serta kiri dan kanan\r\n- Memiliki tenaga yang kuat\r\n- Ukuran mobil: 21 x 13 x 11cm\r\n- Panjang mobil -/+ 20cm\r\n- Lebar -/+ 15 cm\r\n- frekuensi 27mhz\r\n- Apakah ada lampu: ya\r\n\r\nWarna:\r\n- Biru\r\n- Hitam\r\n(Sesuai gambar)\r\n\r\nIsi Paket:\r\n- 1 x Mobil Climbing Offroad\r\n- 1 x Remote Control\r\n- 1 x Baterai Cas 3.7V 500mAh\r\n- 1 x Charger\r\n- Ada lampu\r\n* Menggunakan 2 baterai AA untuk remote (Belum Termasuk)\r\n\r\n\r\n------Model 533------\r\n- Scale 1:18\r\n- Ukuran mobil: 18 x 14 x 12 cm\r\n- Bodi alloy, ban karet\r\n- Frekuensi 27 Mhz\r\n- Full active suspension\r\n- Baterai cas 3.6 volt 500mAh\r\n- Jangkauan hingga 20 meter\r\n- Waktu pengisian: sekitar 40 menit\r\n- Durasi: sekitar 20 menit\r\n- Barang ditest dahulu sebelum dikirim\r\n- Apakah ada lampu: tidak\r\n- Baterai Remote: 2 baterai A2 (Tidak Termasuk)\r\n\r\nIsi paket:\r\n- 1 x Mobil Climbing Offroad\r\n- 1 x Remote Control\r\n- 1 x Baterai Cas\r\n- 1 x Charger\r\n\r\n\r\n------Model 8211------\r\nApakah ada lampu: Tidak\r\nBahan: plastik\r\nSkala: 1 : 20\r\nChannel: 4\r\nBaterai Mobil: 3.6 V / 500 mAh\r\nWaktu pengisian: 60 menit\r\nDurasi: 20-25 menit\r\nBaterai Remote: 2 baterai A2 (Tidak Termasuk)\r\nFrekuensi: 27 Mhz\r\nUkuran mobil: 20 x 12.5 x 12 cm\r\n\r\nIsi Paket:\r\n1 x Mobil Remote\r\n1 x Remote Control\r\n1 x Baterai Mobil\r\n1 x Charger\r\n\r\n\r\n------Model 1118------\r\nApakah ada lampu: Tidak\r\nBahan: plastik\r\nUkuran produk: 21 x 11 x 11 cm\r\nUkuran kemasan: 26 x 13 x 16cm\r\nJenis remote: pistol\r\nWaktu bermain: 30 menit\r\nWaktu pengisian: 2 jam\r\nRentang kendali: 20 meter\r\nTermasuk baterai mobil\r\nRemote control: 2 x baterai A2 (tidak termasuk)\r\n\r\nIsi Paket:\r\n1 x RC Car\r\n1 x Remote Control\r\n1 x USB Cable\r\n1 x Battery', 'Helik Shop Official', 'https://images.tokopedia.net/img/cache/215-square/GAnVPX/2024/1/16/c1cc3fce-13f7-4e63-aa07-b306f85aef7a.jpg'),
(2, 'Etawalin Susu Etawa Original Atasi Nyeri Sendi dan Asam Urat 1 Box', 'https://images.tokopedia.net/img/cache/200-square/VqbcmM/2024/1/18/3a350bb3-b971-43f7-abf7-97ba4e6f9212.png', 'Rp.90.000', 'Nama product : Etawalin\r\nBerat Bersih : 200gr\r\nBPOM : POM TR232052411\r\n\r\nEtawalin - Susu Kambing Etawa 100% Original Solusi Atasi Nyeri Sendi\r\n\r\nApakah Anda sering mengalami nyeri sendi❓\r\n👉🏻 Asam urat sering kambuh❓\r\n👉🏻 Badan nyeri karena rematik ❓\r\n👉🏻 Khawatir tulang tak lagi padat❓\r\n\r\nAWASS❗❗\r\nJangan anggap remeh, itu adalah ciri-ciri kesehatan tulang anda menurun\r\nApa yang terjadi bila Reumatik dan nyeri sendi tidak diobati?\r\n👉🏻 Osteoartritis (Radang Sendi)\r\n👉🏻 Osteoporosis (Pengapuran Tulang)\r\n👉🏻 Tulang Melemah\r\n\r\nJangan khawatir!\r\nKami merekomendasikan Etawalin\r\nEtawalin adalah minuman susu yang terbuat dari susu kambing etawa asli yang dipadukan dengan 5 herbal alami yang diciptakan khusus untuk penderita reumatik, nyeri sendi, hingga asam urat dan sangat berguna untuk meningkatkan kesehatan dan kepadatan tulang.\r\n\r\n🟠Kelebihan Produk :\r\n✅100% Original\r\n✅Bahan berkualitas\r\n✅Sudah terdaftar di BPOM\r\n✅Terbukti berkhasiat\r\n\r\n🟠Aturan minum :\r\n⏰ 2 x 1 sendok makan/hari\r\n\r\nHarga 1 Box Etawalin @90.0000/Box\r\nHarga 3 Box Etawalin @87.000/Box\r\nPaket 12 Box Etawalin Harga Spesial @85.000 (𝐋𝐞𝐛𝐢𝐡 𝐇𝐞𝐦𝐚𝐭).\r\nBeli 25 Box Etawalin Harga Spesial @82.500 ((𝐒𝐚𝐧𝐠𝐚𝐭 𝐋𝐞𝐛𝐢𝐡 𝐇𝐞𝐦𝐚𝐭)\r\n\r\n#SusuKambingEtawa #MeredakanNyeriSendi #NyeriSendi #ObatNyeriSendi #ObatNyeriSendi #SusuKesehatan #Etawalin #SusuNyeriSendi #SusuAsamUrat\r\n#SusuEtawalin #EtawalinOriginal', 'Etawalin', 'https://images.tokopedia.net/img/cache/215-square/GAnVPX/2022/8/1/fdb88136-b936-426a-9649-f3cd84bd3142.jpg'),
(3, 'Philips Air Fryer Compact Connected - HD9255/90 - Regular', 'https://images.tokopedia.net/img/cache/200-square/VqbcmM/2024/2/12/86bd63fa-d220-47d9-a060-50d185860cf1.png', 'Rp.933.000', 'Philips Air Fryer Compact Connected - HD9255/90\r\n\r\nLebih sehat. Lebih enak. Lebih\r\nmudah. Kini dengan internet\r\nAirfryer Terhubung 13-in-1. Goreng, panggang, bakar panggang, dan masih banyak lagi,\r\ndari jarak jauh. Pengalaman memasak terbaik untuk membuat resep sehat dan lezat di\r\nrumah, dikontrol dari jarak jauh dan lebih praktis dari sebelumnya\r\n\r\nAirfryer & NutriU. Teman memasak yang sempurna\r\n• Pantau progres memasak dari jarak jauh melalui aplikasi NutriU dari mana saja\r\n• Inspirasi resep tak terbatas dari para chef dan pengguna NutriU\r\n• Kompatibel dengan Amazon Alexa\r\nDidesain untuk kegiatan memasak sehari-hari\r\n• Sangat fleksibel dan multifungsi penuh, semua dalam satu airfryer\r\n• Layar sentuh dengan 7 prasetel untuk pemilihan yang mudah\r\n• 4,1 Liter - Hingga 4 porsi sekaligus\r\n• Hemat waktu dan energi\r\n• QuickClean dengan komponen yang dapat dilepas dan aman untuk mesin cuci piring\r\nCara menggoreng yang lebih sehat**\r\n• Menggoreng sehat dengan teknologi Rapid Air', 'Pusatbelanjamurah_store', 'https://images.tokopedia.net/img/cache/215-square/GAnVPX/2024/5/8/cfe55b89-441b-4aed-bbb7-0642d8f1deb5.png'),
(4, 'Mainan Anak Remote Control RC Tank Hand Gesture Sensor Tembak Peluru', 'https://images.tokopedia.net/img/cache/200-square/VqbcmM/2023/3/20/3c6f1ad0-7886-4fd2-bf00-940bfc44ede1.png', 'Rp.371.000', 'FITUR\r\nRotasi ~ kepala tank bisa rotasi 180 Derajat\r\nEfek Getar ~ mempunyai efek getar pada saat nembak softbullet (peluru nerf) & orbeez (peluru air), Suara mobil/musik, Lampu headlight & infra untuk membantu nembak tepat sasaran\r\nGerak ~ maju/mundur, belok kiri/kanan, geser kiri/kanan, berputar 360 derajat\r\n3 in 1 ~ kepala tank bisa diganti untuk bubble / orbeez (peluru air) / Softbullet (peluru nerf)\r\nDuel remote ~ Pakai remote biasa atau remote tangan.\r\n\r\nCara Main : https://youtu.be/-H0h0B10zrs\r\n\r\nDALAM BOX 3 in 1\r\n1x kepala tank bubble\r\n2x induk cairan bubble\r\n1x botol untuk cairan bubble\r\n1x kepala tank orbeez\r\n1x tangki peluru orbeez\r\n2x peluru orbeez\r\n1x kepala tank softbullet\r\n1x tabung peluru softbullet\r\n2x perluru soft buleet isi 10pcs\r\n5x kertas panduan\r\n--------------------------------\r\nDALAM BOX Single Head Orbeez\r\n1x kepala tank orbeez\r\n1x tangki peluru orbeez\r\n2x peluru orbeez\r\n2x kertas panduan\r\n------------------------------\r\nDALAM BOX Single Head Soft Bullet\r\n1x kepala tank softbullet\r\n1x tabung peluru softbullet\r\n2x perluru soft buleet isi 10pcs\r\n1x kertas panduan\r\n------------------------------\r\nBAIK 3in1 & SINGLE TETAP DPT ITEM DIBAWAH INI\r\n1x infra\r\n2x baterai charger 18650 1200mAh 3,7V\r\n1x remote control biasa\r\n1x remote control tangan\r\n1x kabel charger USB baterai\r\n1x kabel charger remote tangan\r\n1x pipet untuk isi air asap\r\n\r\nSPESIFIKASI\r\nBaterai : Baterai Lithium 18650 1200mAh 3,7V\r\nBaterai Remote Tangan : 2pcs AAA\r\nWaktu Bermain: 20 menit\r\nWaktu pengisian: 1,5 jam / Sampai Lampu pada charger mati\r\nTidak bisa pakai Baterai Alkaline (harus mix)\r\nNOTE\r\npeluru orbeez perlu direndam air selama 2-3 jam, dan orbeez ukuran 7-8mm diameter dapat dipakai\r\nInduk cairan bubble musti dicampur air secukupnya sesuai dengan botol air yg disediakan\r\nTidak ada garansi\r\nPengajuan Komplain tidak lebih dari 1 x 24jam setelah barang sampai menurut tracking ekspedisi dengan video unboxing dari pertama packing paket dibuka, bukan setelah packing dibuka.\r\nMOHON chat kami jika ada proble', 'Omisetoys', 'https://images.tokopedia.net/img/cache/215-square/GAnVPX/2020/10/13/216abc32-6b0e-433b-a635-c048c890e5e8.png'),
(5, 'RST Rock Crawler 2.4ghz Offroad Remote Control 2WD LED Light RC', 'https://images.tokopedia.net/img/cache/200-square/VqbcmM/2022/2/14/15427de1-b871-43a5-82c7-a3089f658aa6.jpg', 'Rp.140.000', 'Mobil Remote Kontrol Rc ROVER High Speed Climbing\r\nada LAMPU di mobil\r\n\r\nPermainan remote control merupakan permainan anak yang sangat mengasyikan. Permainan yang sangat digemari oleh banyak orang ini selalu memberi kesenangan tersendiri bagi pemainnya.\r\n\r\nDengan design yang sangat menarik, yaitu mobil dengan design Mainan Remote Control Rally Car akan menambah kecerian anak dalam memainkannya. Terbuat dari bahan berkualitas tinggi sehingga aman dan tahan lama. Permainan yang akan menambah imajinasi anak dan juga daya geraknya.\r\n\r\nDimenasi kemasan: 26cmx18cmx15cm\r\nDimensi RC: 20.3cmx14cmx12.5cm\r\nDaya RC: Batre isi ulang Ni-Cd 3,7V 500mAh\r\nDaya remote: AA 2 pcs (tidak termasuk)\r\nBody: Komposit Skala: 1 : 18\r\nRange: 20m\r\nKelengkapan: RC Car + Remot kontrol + batre isi ulang + pengisi daya\r\nUnggulan: 4 aktif suspensi\r\nSkala 1 : 20\r\nKecepatan: 15km/jam\r\nRemote control : Mhz\r\n\r\n\r\nCharger batre dapat berupa kabel data USB, bisa di colok ke charger HP umum atau komputer. Tidak perlu pakai adapter di ujung.', 'JJRC Indonesia', 'https://images.tokopedia.net/img/cache/215-square/shops-1/2019/3/12/5334187/5334187_7d992fb7-0cc4-40c5-b69e-e64c14630f1f.png'),
(6, 'RC MOBIL BATMAN VS SUPERMAN - MAINAN ANAK REMOTE CONTROL', 'https://images.tokopedia.net/img/cache/200-square/product-1/2017/10/12/782240/782240_09fb7abb-7a5e-49c8-b77f-85fa2deab189_675_900.jpg', 'Rp.78.500', 'Mobil batman bisa maju mundur,belok kanan kiri. Panjang mobil 21cm.\r\n\r\nMenggunakan batre AA 3pcs pada mobil dan 2 pcs batre AA pada remote.\r\n\r\nVolumetrik 1kg', 'ANEKA MAINAN ONLINE', 'https://images.tokopedia.net/img/cache/215-square/shops-1/2019/5/8/150508/150508_2eeb66d0-3af9-4410-9ccb-93c9b8be8896.png'),
(7, 'Mainan Remote Control Bus Telolet Basuri Full Lampu', 'https://images.tokopedia.net/img/cache/200-square/VqbcmM/2023/12/15/3074a2fa-95f2-4698-a7dc-a599620bae80.jpg', 'Rp.280.000', '\r\nBaca deskripsi sampai selesai\r\nBarang Selalu ready Tanpa pree Order\r\nSpesifikasi Produk:\r\n- ukuran lebih besar panjang 45 cm\r\ncek foto reall kita\r\n-Bahan multiplek tebal 4mm sehingga kuat dan kokoh.\r\n-Lapis sticker\r\n- Roda belakang dobel\r\n-Full lampu kelap kelip Warna warni\r\n- free batrai\r\n\r\n-Panjang 45cm\r\n- Lebar. 11,5 cm\r\nTinggi. 18 cm\r\n\r\nADA DUA VARIASI PILIHAN\r\n\r\n# FULL LAMPU - lampu memakai lampu kelap kelip warana warni free batrai\r\n# FULL LAMPU ADA TELOLET BASURI\r\n*suara isi 10 nada telolet memory card 2gb\r\n* telolet bisa carger hp di kirim kabel tanpa\r\nkepala bisa pakai cash hp\r\n* bisa blotot suara ( Tombol + dan - di samping dengan tekan\r\nbisa untuk pindah nada selanjutanya...\r\n#untuk mengurangi volume tahan -\r\n# untuk menambah volume tahan +\r\n\r\n* PAKiNG AMAN!!!\r\nSUDAH KARDUS TEBAL DOBEL PLASTIK BUBBLE WRAP\r\n\r\nDI KIRIM SECEPATNYA SESUAI ANTIAN BURUAN DI ORDER UNTUK CEPAT DI KIRIM\r\n*Jangan lupa klaim vocer potongan diskon kaka*\r\n\r\nProduk miniatur kami sangat cocok untuk hadiah/kado ultah, hiasan/pajangan dan mainan anak,-anak.', 'AFminiatur', 'https://images.tokopedia.net/img/cache/215-square/shops-1/2021/8/13/11547623/11547623_20193469-f943-4bf8-ae96-d6e42f28f835.jpg'),
(8, 'Mobil Remote Kontrol OFF ROAD 4WD 2.4Ghz Mainan RC Remot Control', 'https://images.tokopedia.net/img/cache/200-square/VqbcmM/2023/6/4/53681b11-de26-4e46-951d-6343a9194b7c.jpg', 'Rp.239.000', 'Mobil RC 4WD Terbaru Bodi Metal\r\nFrekwensi 2.4Ghz sinyal anti bentrok\r\n\r\nSpesifikasi JPRE :\r\nSkala 1:16 bodi metal\r\nUkuran mobil 26 x 18 x 17cm\r\n4WD full active suspension\r\nBan dari karet model off-road\r\nTangguh di tanjakan dan bebatuan\r\nBaterai cas 7.4Volt 1000mAh\r\n\r\n\r\nSpesifikasi TOKIN BIG :\r\nSkala 1:12 bodi metal\r\nUkuran mobil 36 x 22 x 19cm\r\n4WD full active suspension\r\nBan dari karet model off-road\r\nTangguh di tanjakan dan bebatuan\r\nBaterai cas 7.2Volt 2000mAh\r\n\r\n\r\nPAKET PEMBELIAN :\r\nUnit mobil\r\nRemote control\r\nBaterai mobil\r\nCharger USB\r\nFree baterai remote\r\n\r\n\r\nPENTING\r\nSebelum pemakaian, baterai mobil wajib dicas 1-3 jam agar dapat berfungsi normal', 'Pojok Diecast', 'https://images.tokopedia.net/img/cache/215-square/shops-1/2020/7/9/310517/310517_13aa3f4f-1828-48f4-bd26-29b34056ff44.jpg'),
(9, 'Kantong Plastik Gulung Isi 100 Lembar / Kantong Plastik Sampah', 'https://images.tokopedia.net/img/cache/200-square/VqbcmM/2021/10/24/6dd69ea3-a290-4a01-853d-f18dd3e3358a.jpg', 'Rp.15.500', 'Size: 45X50cm\r\n1 gulung isi : +/-  15 s/d 20 lembar \r\nHarga per pack isi:  5 gulung\r\n\r\n\r\nFITUR :\r\nBAHAN ORGANIK BIODEGRADEABLE\r\nMUDAH DIBAWA\r\nTIPIS DAN KUAT\r\n\r\nCATATAN :\r\nTERSEDIA WARNA :\r\nHITAM\r\nHIJAU\r\nBIRU\r\nUNGU\r\nPINK\r\nKUNING\r\n\r\nNB : MOHON CANTUMKAN WARNA YANG DI INGINKAN DIKOLOM CATATAN,\r\nJIKA TIDAK ADA CATATAN AKAN KAMI KIRIM RANDOM.\r\nJIKA WARNA YANG DIPILIH KOSONG MAKA AKAN DIKIRIM SECARA RANDOM TANPA DIKONFIRMASI\r\n\r\n\r\nTERIMAKASIH SUDAH BERBELANJA DI TOKO KAMI🤗', 'Laris868', 'https://images.tokopedia.net/img/cache/215-square/shops-1/2020/12/10/9212758/9212758_ca3a8fe2-8d5c-46a4-9cba-2ebfad1bcc0c.jpg'),
