(14, 'MILIFE LAPTOP STAND ALUMINIUM TABLET HOLDER FOLDABLE DUDUKAN PORTABLE', 'https://images.tokopedia.net/img/cache/200-square/VqbcmM/2022/10/6/8a04e9a1-e0f5-4911-9c73-4f7ed023e305.jpg', 'Rp.99.000', 'MiLife make innovation come true.\r\nElevate your precious life with us \"MiLife Smart Ecosystem\"\r\nCome & get your Smart Home Product with us.\r\n\r\nKeunggulan:\r\n1. Atur maksimal ketinggian mulai dari 5 cm hingga tinggi maksimal 15 cm.\r\n2. Ukuran sangat portable dan design yang compact.\r\n3. Material kuat dan tidak mudah pudar dengan dukungan aluminium alloy yang biasa digunakan untuk material pesawat.\r\n4. Kaki holder terbilang kuat untuk menopang laptop / tablet berukuran hingga 17 inch.\r\n5. Bagian dudukan laptop dibekali silicon anti-slip, agar laptop aman dari resiko jatuh dan lecet saat diaplikasikan diatasnya.\r\n6. Dudukan laptop juga dibekali dengan celah-celah yang cukup lebar untuk memaksimalkan sirkulasi udara saat laptop digunakan.\r\n7. Dapat dilipat dan dilengkapi dengan free pouch.\r\n8. Membantu memperbaiki postur tubuh ketika duduk di depan layar\r\n----------------------------------------------------------------------------------\r\nSpesifikasi Produk:\r\nMaterial: Aluminium Alloy Material + Silikon\r\nIsi Kemasan:\r\n1x Laptop/Tablet Stand Holder Aluminium Alloy\r\n1 x Free Pouch\r\nColor: Phantom Black, Titanium Silver\r\nTinggi dapat diatur\r\n\r\nMenopang laptop berukuran hingga 17 inch.', 'MiLife Official', 'https://images.tokopedia.net/img/cache/215-square/shops-1/2020/10/15/1024960/1024960_b9b37134-3875-45f7-80c4-4f42b27dfb65.jpg'),
(15, 'MIXIO A8 Gimbal Stabilizer Hanphone Selfie Stick Tripod Anti Goyang', 'https://images.tokopedia.net/img/cache/200-square/VqbcmM/2024/2/26/698aaf81-d8c1-48d1-b494-436fd6ba3867.jpg', 'Rp.596.000', 'MIXIO A8 Gimbal Stabilizer Hanphone Selfie Stick Tripod Anti Goyang Bahan aluminium,Multifungsi Bisa Gimbal / Bisa jadi Tripod tongsis bluetooth! Dipanjangin bisa 120CM\r\n\r\nIsi dalam box :\r\n1x A8 Gimbal Stabilizer\r\n1x Pouch\r\n1x Led (sudah pasang di gimbal)\r\n1x Remot Control (sudah pasang di gimbal)\r\n1x Kabel charging Usb-C\r\n\r\nSpesifikasi\r\nProduct Name: A8 Gimbal Stabilizer\r\nMaximum load capacity of the head: 300g\r\nBahan Utama : Aluminum Alloy + ABS\r\nPanjang diperpanjang : 120CM\r\nPanjang dierpendek : 21CM\r\nberat ：215g\r\nPort Pengisi Daya ：Type-C\r\n\r\nOperating voltage: 3.3~4.2V\r\nCharging voltage: DC 5V\r\nWorking temperature: 0~50°C\r\nBattery capacity Gimbal: 500mAh\r\nBattery capacity Remot: 55mAh\r\nProduct Size: 61*107.5*210.3mm\r\nMaximum stretching distance: 82mm\r\nSupport system: Android, IOS, HarmonyOS\r\n\r\n【Anti guncangan cerdas】：menggunakan prosesor daya komputasi super, dilengkapi dengan motor presisi tinggi, system algoritme anti guncangan yang unik. Keseimbangan otomatis, mudah utuk merekam video dan gambar selfie berkualitas tinggi.\r\n\r\n【Gimbal Stabilizer Multifungsi】：Gimbal Stabilizer A8 dapat digunakan dengan atau tanpa aplikasi\r\n1.Mempunyai 3 mode (3 in 1) Mode Gimbal Desktop (Dapat berputar 360 derajat dari kiri ke kanan)\r\nMode Gimbal Stabilizer and mode Tongkat Selfie\r\n2.Bidikan panorama 360°, satu kali klik mudah untuk memotret blockbuster.\r\n3.Pelacakan pintar, template pemotretan, dan lebih banyak fungsi.\r\n4.Cahaya kecantikan, dapat disesuaikan dengan 3 jenis warna untuk memenuhi penggunaan dalam beberapa agedan.\r\n5.Remote Control Bluetooth yang dapat dilepas.', 'MIXIO Official Store', 'https://images.tokopedia.net/img/cache/215-square/GAnVPX/2020/12/9/1e0aad15-8e87-4435-9030-8a2ab08ad2c0.jpg'),
(16, 'Universal Phone Stand iPhone Samsung Magnetic Adhesive Getgard - Plate only, Silver', 'https://images.tokopedia.net/img/cache/200-square/VqbcmM/2021/8/17/6c627787-81ed-4254-a79e-fff9e47aba8b.jpg', 'Rp.8.000', 'Universal stand hp, bisa untuk hampir semua hp, silahkan di ukur terlebih dahulu (ukuran ada di gambar)\r\n\r\nTersedia 2 tipe:\r\n- Adhesive, pemasangannya menggunakan perekat,\r\n- Magnetic, pemasangan dengan magnet, cocok untuk hp dengan built in magnet seperti iPhone 12 series\r\n\r\nBisa di gunakan ditablet ukuran maximum 8\", posisi landscape.\r\n\r\nMohon perhatian untuk tipe magnetic:\r\nJika anda memilih tipe magnetic dan hp anda belum memiliki built in magnet, silahkan pilih yang 1 set dengan metal plate (di jual terpisah)\r\n\r\nPenggunaan case/casing hp, metal plate harus di pasang di sisi luar, seperti di gambar.\r\n\r\n- The Snap-On Mag-Safe Stand & Wallet Designed with both style and function in mind.Compatible with iPhone 12mini/12/12 Pro/12 Pro Max. It can also be snapped to Mag-Safe cases\r\n- Designed with a magnet inside of card holder, strong magnetic and light weight, easy to use and remove.\r\n- The phone stand is more than a strong phone stand. Can be used for multiple viewing angle, portrait, landscape, and the new Floating mode (magnetic version only)\r\n- Weighing mere 1oz, 5mm thin, it doesn’t add any bulk to your phone or any burden on your daily outgoing activities.\r\n\r\n===============================\r\nFAQ:\r\n- Jadwal kirim bisa di cek di catatan toko\r\n- Sameday max jam 14.00 WIB\r\n- Cut off order jam 16.00 WIB\r\n- Semua barang garansi original\r\n- Semua barang di buka untuk di cek (cantumkan di catatan kalau tidak ingin dibuka)', 'GET-WID Official', 'https://images.tokopedia.net/img/cache/215-square/GAnVPX/2022/1/17/5f84e8bb-c9e5-48d1-9b23-26e332ea81eb.jpg'),
(17, 'Gimbal Hanphone Gimbal Stabillizer Selfie Stabilizer Anti Goyang Q08', 'https://images.tokopedia.net/img/cache/200-square/hDjmkQ/2021/8/31/fac6adb0-1686-43e9-84c6-b4b8f53b5604.jpg', 'Rp.218.000', 'TERMURAH Selfie Stabilizer Q08 Bluetppth dengan Shooter\r\n\r\nfitur:\r\n1. Ini Adalah Self-timer Berdiri Dan Stabilizer Untuk Mencegah Buram Gerakan;\r\n2. Penstabil, Anti Goncangan Cerdas, Rekam Film Besar, Jauh Dari Jitter;\r\n3. Tidak Perlu Aplikasi, Ini Dapat Digunakan Untuk Memulai;\r\n4. Anda Dapat Melakukannya Di Segala Arah, Apapun Yang Anda Suka;\r\n5. High-end Stabil Aluminium Alloy Rod.\r\n\r\nBahan: ABS + Paduan Aluminium\r\nProduct Reference : 195 x 70 x 40 mm\r\nMount Holder : 58-108mm\r\nCollapsed Lenght :195mm\r\nExrended Lengt :755mm\r\nVersi Bluetooth: Bluetooth 4.0\r\nJarak Transmisi Bluetooth: 10m\r\nSistem Android: Android 4.3 Atau Di Atas\r\nUntuk Sistem IOS: Ios 5.1 Atau Nanti Dukungan\r\nUkuran Telepon: 4.0-6.2 Inci\r\n\r\nIsi Kemasan: 1 X Selfie Tongkat Bluetooth Remote Control dan buku manual', 'VQ TECHNOLOGY', 'https://images.tokopedia.net/img/cache/215-square/GAnVPX/2021/11/7/3396e20f-5ce0-4050-b1f8-7192cfc34037.jpg'),
