di poles dengan lap / tisu\r\n▪Diamkan 15 menit hingga kering, beri lapisan kedua untuk hasil lebih maksimal (jika diperlukan)\r\n\r\nTIPS:\r\n1. Jika terdapat jamur/kerak pada body, wajib bersihkan dulu dengan Bellomax - Mush Killer\r\n2. Untuk perawatan rutin gunakan Max Black maks 1 bulan 1x', 'BELLOMAX OFFICIAL', 'https://images.tokopedia.net/img/cache/215-square/GAnVPX/2021/2/17/3047b43f-69b3-44bd-8ac0-d242b42a0af4.png'),
(33, 'Philips Air Fryer Compact Connected - HD9255/90 - Regular', 'https://images.tokopedia.net/img/cache/200-square/VqbcmM/2024/2/12/86bd63fa-d220-47d9-a060-50d185860cf1.png', 'Rp.992.000', 'Philips Air Fryer Compact Connected - HD9255/90\r\n\r\nLebih sehat. Lebih enak. Lebih\r\nmudah. Kini dengan internet\r\nAirfryer Terhubung 13-in-1. Goreng, panggang, bakar panggang, dan masih banyak lagi,\r\ndari jarak jauh. Pengalaman memasak terbaik untuk membuat resep sehat dan lezat di\r\nrumah, dikontrol dari jarak jauh dan lebih praktis dari sebelumnya\r\n\r\nAirfryer & NutriU. Teman memasak yang sempurna\r\n• Pantau progres memasak dari jarak jauh melalui aplikasi NutriU dari mana saja\r\n• Inspirasi resep tak terbatas dari para chef dan pengguna NutriU\r\n• Kompatibel dengan Amazon Alexa\r\nDidesain untuk kegiatan memasak sehari-hari\r\n• Sangat fleksibel dan multifungsi penuh, semua dalam satu airfryer\r\n• Layar sentuh dengan 7 prasetel untuk pemilihan yang mudah\r\n• 4,1 Liter - Hingga 4 porsi sekaligus\r\n• Hemat waktu dan energi\r\n• QuickClean dengan komponen yang dapat dilepas dan aman untuk mesin cuci piring\r\nCara menggoreng yang lebih sehat**\r\n• Menggoreng sehat dengan teknologi Rapid Air', 'Pusatbelanjamurah_store', 'https://images.tokopedia.net/img/cache/215-square/GAnVPX/2024/5/8/cfe55b89-441b-4aed-bbb7-0642d8f1deb5.png'),
