(41, 'Minyak Goreng Refill Segi Tiga Emas 1L - Twinpack', 'https://images.tokopedia.net/img/cache/200-square/VqbcmM/2023/6/26/e5a1246e-7878-455f-b200-baa0bc268f1b.jpg', 'Rp.33.600', 'Minyak Goreng Segi Tiga Emas 1 Liter\r\n\r\nBELI 2 LEBIH MURAH\r\n\r\nIsi paket:\r\n2 x Minyak Goreng Segitiga Emas 1L\r\n\r\nMinyak goreng di buat dari kelapa sawit pilihan dan secara PREMIUM MULTI PROSES tanpa bahan pengawet yang menghasilkan minyak dengan warna kuning alami berasal dari sawit alam berkualitas. Deangan Proses 2 kali penyaringan sehingga menghasilka minyak goreng yang jernih dan sehat.\r\n\r\nKeunggulan Minyak Goreng Segi Tiga Emas :\r\n1. Diproduksi dengan bahan pilihan yang berkualitas secara Premium Multi Proses.\r\n2. Diproses melalui 2 kali penyaringan sehingga menghasilkan minyak yang jernih dan sehat\r\n3. Mengandung Omega-9.\r\n4. Sertifikasi BPOM, HALAL, SNI.\r\n5. Tersedia dalam berbagai jenis kemasan yang dapat disesuaikan dengan kebutuhan\r\n\r\nUkuran : 1 Liter x 2 Pcs\r\nMaterial : Pouch\r\nEXPIRED DATE : Desember 2026\r\n\r\nGunakan selalu minyak yang berkualitas. Karena lebih jernih, hemat pemakaiannya, cepat panas, serta tahan terhadap panas.', 'Segitiga Emas Official Store', 'https://images.tokopedia.net/img/cache/215-square/GAnVPX/2022/10/6/32b57826-abc8-4efe-a5d1-8af2b269ba48.jpg'),
(42, 'Switch Saklar Foglamp Kabut Brio Mobilio Jazz City Civic CRV Freed', 'https://images.tokopedia.net/img/cache/200-square/VqbcmM/2023/8/26/ac3ab379-a6d1-40d9-88da-b42a607bccf3.jpg', 'Rp.50.000', 'Tombol saklar foglamp 4 kabel lengkap dengan socket dan kabel.\r\nBahan: ABS\r\nWarna LED: Kuning\r\nInput: DC 12V\r\n\r\nCocok untuk dashboard\r\n- Accord 1999-2013\r\n- Brio 2012-2018\r\n- City\r\n- CRV 2002-2011 (Di ukur lagi)\r\n- Freed\r\n- Mobilio 2012-2014', 'berkahadistore', 'https://images.tokopedia.net/img/cache/215-square/GAnVPX/2024/1/15/242c4f1d-1a27-476a-bf45-0b5d730f844c.jpg'),
(43, 'Kit Glass Polish 170mL', 'https://images.tokopedia.net/img/cache/200-square/VqbcmM/2022/7/26/cc5669c4-aa3a-4a27-b4e8-1e58dfa7bea8.jpg', 'Rp.33.258', 'Kit Glass Polish 170mL\r\n- Membersihkan serta menghilangkan jamur kaca dan goresan halus pada permukaan kaca\r\n- Dapat digunakan untuk kaca bagian dalam dan luar mobil\r\n- TIdak merusak kaca film', 'sinar surya toko', 'https://images.tokopedia.net/img/cache/215-square/shops-1/2020/12/7/4878723/4878723_6cf7a97d-ef99-4507-a079-638800c8e797.jpg');
INSERT INTO `products` (`id`, `name`, `image_url`, `price`, `description`, `nama_toko`, `image_toko`) VALUES
(44, 'Philips LOW WATT Air Fryer HD9200/91 - 800 Watt', 'https://images.tokopedia.net/img/cache/200-square/VqbcmM/2023/3/29/65feb345-1f9a-4771-b3a7-fbba053df40f.jpg', 'Rp.802.000', 'Menggoreng sehat dengan teknologi Rapid Air\r\nRapid Air Technology, dengan desain bintang laut yang unik, memutar udara panas untuk menghasilkan makanan lezat yang renyah di luar dan lembut di dalam, dengan sedikit atau tanpa minyak tambahan.\r\n\r\nResep Airfryer yang lezat untuk hidup sehat\r\nTemukan ratusan resep Airfryer yang lezat, sehat, dan cepat untuk dibuat. Resep di aplikasi NutriU dikurasi oleh para ahli nutrisi untuk kegiatan memasak sehari-hari.\r\n\r\nResep disesuaikan dengan preferensi Anda\r\nDapatkan rekomendasi resep harian yang sesuai dengan preferensi keluarga Anda. Semakin sering Anda menggunakan NutriU, semakin baik rekomendasi resep yang diberikan sesuai kebutuhan Anda. Dapatkan inspirasi dari juru masak lain, dan ikuti orang-orang dengan selera yang serupa.\r\n\r\nRapid Air Technology\r\n4.1L\r\n800Watt', 'Philips Home Appliances', 'https://images.tokopedia.net/img/cache/215-square/shops-1/2020/8/18/2004256/2004256_d47e2c2a-582e-4731-b349-1303122e8494.jpg'),
(45, 'Week Aqua Z400 SEA Z FULL SPECTRUM + UV Marine Aquarium Lightning', 'https://images.tokopedia.net/img/cache/200-square/VqbcmM/2023/12/14/1768c63b-65b0-473b-ab09-765bff7c4e53.jpg', 'Rp.2.499.000', 'WEEK AQUA Z400 SEA\r\nWarranty 12 Month / Garansi 12 bulan\r\n\r\nFeature\r\nSmartphone app control\r\nDimming function\r\nTimer function\r\n\r\nSpectrum suitable for marine fish and coral growth\r\n\r\n- UV 395nm UVA 405nm\r\nUV meningkatkan pertumbuhan, menstimulasi warna karang, dan melepaskan fluoresensi tambahan pada ikan dan karang.\r\n\r\n- VIOLET 415 nm, COOL BLUE 430 nm, ROYAL BLUE 450 nm\r\nCahaya biru meningkatkan fotosintesis coral, pertumbuhan coral lebih baik, peningkatan rendering warna coral, dan efek tampilan yang lebih baik.\r\n\r\n- GREEN 520nm RED 660nm WHITE\r\nMempromosikan pertumbuhan, menyeimbangkan suhu warna, meningkatkan indera penglihatan.\r\n\r\n\r\n- DEEP BLUE 460nm ROYAL BLUE 470nm\r\nMempromosikan fotosintesis zooxanthellae, menunjukkan warna fluoresen parsial, membuat pengendapan pigmen dan rendering warna lebih baik.\r\n\r\nwatt 120 w\r\nLED qty 120 (5054)\r\n\r\nDimensi lampu 40 x 14 x 3 cm', 'Java Reef', 'https://images.tokopedia.net/img/cache/215-square/shops-1/2016/4/22/8814632/8814632_243edff6-d1ca-4568-9193-a55127a4dc1b.jpg'),
(46, 'G01 Neck Fan 1500mAh / Kipas Angin Leher Portable', 'https://images.tokopedia.net/img/cache/200-square/VqbcmM/2022/8/3/6ad6c5e0-adb9-4be3-b446-03acf5cbca25.jpg', 'Rp.90.000', 'Spesifikasi:\r\n\r\n- Bahan: Selang silikon + ABS\r\n- Warna: putih, merah muda, hijau tua\r\n\r\n- Waktu pengisian: +- 2 jam\r\n-Ukuran : 66.5*66.5*44mm\r\n\r\nIsi dalam Paket:\r\n1 *usb Type c\r\n\r\n\r\n\r\nSyarat ketentuan Garansi.\r\n2. ulasan tidak berbau NEGATIF.\r\n3. Video Unboxing', 'Jayabaya Elektronik', 'https://images.tokopedia.net/img/cache/215-square/GAnVPX/2024/4/3/06562dcc-204a-49bd-b4c3-711111552a12.jpg'),
(47, 'Jam Dinding Seiko 32cm Chrome Stainless', 'https://images.tokopedia.net/img/cache/200-square/VqbcmM/2024/2/18/8a83a571-e325-4e93-b8da-59ace4eb9555.jpg', 'Rp.124.200', 'etalase: JAM DINDING SEIKO\r\nJam Dinding Seiko \r\nSuper Premium\r\nChrome Stainless\r\nMesin Sweep & Step\r\nInclude Baterai A2 1pcs \r\n\r\nProduk Sebelum Dipacking Selalu Kami Cek Terlebih Dahulu ya ,,,,\r\n\r\nPacking Free Bouble wrap+Kardus \r\n\r\n👉Uk 32cm & 36cm\r\n👉Stok Selalu Ready \r\n   ', 'Power Merchant\r\nWMCshop', 'https://images.tokopedia.net/img/cache/215-square/GAnVPX/2023/10/28/3c854b18-35f1-4f8f-936d-2557af1100b4.jpg'),
(48, 'Mesin Jam Dinding Seiko SKP Original', 'https://images.tokopedia.net/img/cache/200-square/product-1/2017/9/2/25869967/25869967_fec517c2-610b-4042-9709-35fee84bc452_640_637.jpg', 'Rp.47.450', 'Mesin jam dinding SKP Seiko Original\r\n\r\nmesin jam dinding seiko standar movement\r\nfree jarum+ring dan mur\r\n\r\nTidak garansi', 'Sumber Berkat Elektronik', 'https://images.tokopedia.net/img/cache/215-square/shops-1/2019/4/30/1258446/1258446_793c0a33-6043-4908-a5bb-1d57094cb357.png'),
(49, 'SVRG. Liquid Chalk - Kapur Cair Pull Up - Magnesium - Climbing', 'https://images.tokopedia.net/img/cache/200-square/VqbcmM/2023/7/14/ee37de18-9d7f-4683-bfef-b9c36d8aa20c.jpg', 'Rp.79.000', '\r\nSvarga Premium Liquid Chalk\r\n\r\nSvarga Premium Liquid Chalk berkualitas premium yang bisa membuat pengalaman olahraga anda menjadi lebih fokus dan dapat meningkatkan progres anda dengan cepat. Ketika dioles ke telapak tangan anda, Svarga Premium Liquid Chalk akan membuat cengkraman anda menjadi lebih kuat dan menghindari licinnya keringat dari telapak tangan anda.\r\n\r\nKelebihan Svarga Premium Liquid Chalk :\r\n- Membuat grip anda menjadi lebih kuat sehingga memungkinkan anda mengangkat lebih berat.\r\n- Menghindari serbuk dari kapur menyebar yang membuat sekitaran anda menjadi kotor.\r\n- Tahan Lama, kering dengan cepat dan gampang digunakan.\r\n- Mudah dibersihkan dengan cara mencuci dengan air hangat dan sabun.\r\n- Jika dipakai terus menerus tidak menyebabkan kulit kering.\r\n\r\nSvarga Premium Liquid Chalk memiliki tekstur yang lembut sehingga bisa mengurangi resiko telapak tangan anda menjadi kapalan, Cocok untuk olahraga Cross-Fit, Wall Climbing, Body Builder, Penggunaan Gymnastic Ring, Deadlifts, Tenis dan Latihan lainnya\r\nSpesifikasi Produk :\r\n\r\n- Bahan : Alcohol Magnesium Carbonate, Hydroxyprophy Celluose, dan Colophonium\r\n- Isi : 50 ml', 'SVARGA YOGA\r\n', 'https://images.tokopedia.net/img/cache/215-square/GAnVPX/2022/12/20/bd9a625a-852f-4bba-9f21-f6a6f3c6be6a.jpg'),
(50, 'Mesin Jam Dinding SKP Seiko Sweep (Original)', 'https://images.tokopedia.net/img/cache/200-square/VqbcmM/2023/11/9/81b4a9ec-16da-4ce7-86b0-84c2dcbbdecc.jpg', 'Rp.68.500', 'Mesin jam dinding SKP Sweep Seiko Original\r\nPutaran jenis SWEEP / TIDAK BERDETAK\r\n\r\nmesin jam dinding seiko Sweep movement\r\nfree jarum+ring dan mur\r\n\r\nTidak garansi\r\n', 'Sumber Berkat Elektronik', 'https://images.tokopedia.net/img/cache/215-square/shops-1/2019/4/30/1258446/1258446_793c0a33-6043-4908-a5bb-1d57094cb357.png'),
(51, 'Pintu Aluminium', 'https://images.tokopedia.net/img/cache/200-square/product-1/2020/4/27/404322404/404322404_ff6ca09e-a521-4881-8385-4e732c134259_1080_1080.jpg', 'Rp.2.400.000', 'Detail Produk & Spesifikasi Material :\r\nAlumunium tebal Berat : 20 kg\r\nUkuran : 70x200 Cm\r\nRingan, tidak berkarat, kokoh\r\nDapat digunakan sebagai pintu kamar mandi, dan kamar tidur\r\nDilengkapi dengan handle dan kunci\r\nLengkapi kebutuhan pintu hunian dengan Pintu Rumah Aluminium Minimalist Europe Enchanting GR01.\r\nPintu ini bisa digunakan sebagai pintu kamar mandi, pintu dapur, atau pintu kamar tidur.\r\nBahan alumunium tidak berkarat, lebih ringan, dan tidak memerlukan perawatan khusus sehingga lebih mudah digunakan.\r\nPada sisi tengah pintu dilengkapi kaca Varian: bukaan kiri dan bukaan kanan', 'Europe Enchanting', 'https://images.tokopedia.net/img/cache/215-square/GAnVPX/2024/1/27/48232ffa-a92a-44aa-bdea-9ce10cff8817.jpg'),
(52, 'Patris Esther Mules Wanita Heels / Hak 3 Cm', 'https://images.tokopedia.net/img/cache/200-square/hDjmkQ/2023/8/26/e5a290bc-a819-4505-a9f1-c82a69d6d3c8.jpg', 'Rp.189.750', 'Sepatu mules cocok untuk acara formal maupun casual, dengan model cantik dan empuk yang menambah kenyamanan mules ini.\r\n\r\n\r\n- Kondisi : 100% Baru, Empuk, Berkualitas Tinggi\r\n- Bahan : Kulit Sintetis\r\n- Sol : Non-slip sol\r\n- Warna : Beige Sylitus / Biscuit Overt / Black Croise / Cream Sickle\r\n- Tinggi heel : 3 cm\r\n\r\nFoto :\r\n- Semua foto produk kami REAL PICT, kami foto sendiri langsung dari produknya.\r\n- Foto Produk adalah COPYRIGHT dari toko kami, untuk reseller yang membutuhkan foto silahkan chat saja.\r\n\r\nSize (Insole Panjang Sepatu) :\r\n- 37 : 23 cm\r\n- 38 : 23.5 cm\r\n- 39 : 24 cm\r\n- 40 : 25.5 cm\r\n- 41 : 26 cm\r\n\r\n\r\nPENGIRIMAN PATRIS :\r\n- Silahkan di klik BELI jika stok tersedia / Ready stock dan pilih sesuai VARIASI yang diinginkan, dan apabila karena satu dan lain hal kami tidak bisa mengirimkan tepat waktu, maka akan kami hubungi via CHAT\r\n- Pesanan yang telah diverfikasi sebelum jam 15.00 akan kami kirimkan di hari yang sama, jika lebih dari itu akan diproses sehari setelahnya (kecuali status pengiriman PO)\r\n- Proses pickup dan update resi dari ekspedisi berlangsung dari jam 17.00 - 24.00 WIB.\r\n- Patris tidak ada pengiriman setiap hari minggu dan tanggal merah, pesanan yang masuk pada hari minggu dan tanggal merah akan dikirimkan pada hari berikutnya.\r\n- Status pengiriman PO adalah untuk mengantisipasi banyaknya pesanan disesuaikan dengan kapasitas produksi kami.\r\n-Jika ada keluhan, produk yg diterima tidak sesuai, dsb silahkan hubungi Admin kami melalui chat. Sebelum memberikan penilaian silahkan hubungi Admin kami terlebih dahulu karena semua permasalahan kalian akan dibantu hingga selesai . Jadi kami harap bisa menerima review penilaian dan bintang yang baik.', 'Patris Official Store', 'https://images.tokopedia.net/img/cache/215-square/GAnVPX/2022/4/6/027010c9-6ab0-4819-b8b3-723977a08936.png'),
(53, 'G01 Neck Fan 1500mAh / Kipas Angin Leher Portable', 'https://images.tokopedia.net/img/cache/200-square/VqbcmM/2022/8/3/6ad6c5e0-adb9-4be3-b446-03acf5cbca25.jpg', 'Rp.90.000', 'Kipas gantung\r\n\r\n42\" ANGREK-1\r\n- Fan Name : ANGREK-1\r\n- Blade Sweep : 42\"\r\n- Motor Type : ac\r\n- No. of Blades : 5 plastic\r\nr Size (mm) : 1070mm\r\n- Light Source : No\r\n- Light Type : no\r\n- Control System : Remote Control\r\n- Voltage : 220 - 240 V\r\n- Frequency : 50\r\n- Max. Watt (Without Light) :55 W\r\n- Max. RPM : 250\r\n- Max. CFM : 6107\r\n\r\n\r\nPilihan Warna :\r\n- Black\r\n\r\n\r\n', 'Ecolux Fan Indonesia', 'https://images.tokopedia.net/img/cache/215-square/GAnVPX/2021/8/31/abbcfd9a-bdfe-41f0-81c3-8f4608fc46ba.jpg'),
(54, 'Handle Pintu Set Kunci PALOMA LPP 712 Kunci Pintu Rumah Gagang Pintu', 'https://images.tokopedia.net/img/cache/200-square/VqbcmM/2022/2/20/4d021459-156e-4582-a029-7a4513dd8606.png', 'Rp.264.000', '\r\nFeatures & Specification:\r\n\r\n- Material handle: Iron Aluminium finishing nickel\r\n- Material mortise lock: Stainless steel, tahan karat dan korosi.\r\n- Material cylinder: Brass (kuningan), nickel plated.\r\n- Ukuran backset 40 mm.\r\n- Ukuran C-C (lubang as handle ke lubang as cylinder) 85 mm.\r\n- Garansi mekanikal selama 5 tahun.\r\n\r\n', 'GERAI KUNCI KENARI MAS', 'https://images.tokopedia.net/img/cache/215-square/GAnVPX/2023/3/7/53a40b24-88a1-438a-9762-57f1bf5b826d.jpg'),
