(62, 'Confidence Popok Celana Dewasa M L XL 1 pc Satuan Renceng - L', 'https://images.tokopedia.net/img/cache/200-square/hDjmkQ/2023/12/3/bd87929b-127a-456b-8d33-f9195b3fec94.png', 'Rp.4.999', 'Selamat datang di toko yourdailyvitamin!\r\nPesanan dibawah pukul 17.00 dikirimkan di hari yang sama.\r\n\r\nConfidence Popok Dewasa Adult Pants\r\n\r\nUkuran pinggang:\r\nM: 55-90 cm\r\nL: 80-120 cm\r\n\r\nPopok Dewasa Confidence Adult Pants merupakan popok Celana untuk kondisi lansia aktif(inkontinensia) yang mudah digunakan. Bentuknya pas di badan, tidak menggelembung ketika dipakai serasa menggunakan celana dalam biasa. Confidence Adult Pants memiliki daya serap yang tinggi sehingga bisa dipakai lebih lama dan tidak perlu khawatir ketika tidak sempat mencapai toilet. Orang tua menjadi lebih Confidence untuk beraktivitas sehari-hari\r\n\r\nSlim & Fit\r\nPopok dewasa Confidence Adult Pants dibuat Slim & Fit di badan, Tidak menggelembung ketika dipakai serasa menggunakan celana dalam biasa.\r\n\r\nUltra Soft Cover\r\nPermukaan luarnya berbahan Clothlike selembut kain(bukan plastik) sehingga terasa sejuk, tidak panas membuat kulit nyaman dan terhindar dari iritasi.\r\n\r\nExtra Absorbency\r\nPopok dewasa Confidence Adult Pants dilengkapi dengan daya serap extra sehingga aman untuk digunakan sehari-hari dan orang tua tidak perlu khawatir ketika tidak sempat mencari Toilet\r\n\r\nSide Leak Guard\r\nMemiliki Pelindung samping anti bocor sehingga tidak perlu khawatir terjadi kebocoran.\r\n\r\nAnti Bacteria\r\nPopok dewasa Confidence Adult Pants memiliki Anti Bacteria yang membantu mencegah timbulnya bakteri yang dapat menyebabkan kulit iritasi\r\n\r\n', '\r\nYourDailyVitamin', 'https://images.tokopedia.net/img/cache/215-square/GAnVPX/2021/5/24/4f5eec96-3486-40e7-aa27-4016c5c79c31.jpg'),
(63, 'Sandal Heels Wanita Patris Charlene Hak 7 cm', 'https://images.tokopedia.net/img/cache/200-square/VqbcmM/2023/8/18/cd4ba221-a712-44d3-a46d-7bf4cf1bc9d7.jpg', 'Rp.189.750', 'Foto :\r\n- Semua foto produk kami REAL PICT, kami foto sendiri langsung dari produknya.\r\n- Foto Produk adalah COPYRIGHT dari toko kami, untuk reseller yang mebutuhkan foto silahkan chat saja.\r\n\r\nSize (Insole Panjang Sepatu) :\r\n- 37 : 23 cm\r\n- 38 : 23.5 cm\r\n- 39 : 24 cm\r\n- 40 : 25.5 cm\r\n- 41 : 26 cm\r\n\r\nSize (Patokan Panjang Kaki) :\r\n- 37 : 22.5 cm\r\n- 38 : 23 cm\r\n- 39 : 23.5 cm\r\n- 40 : 24 cm\r\n- 41 : 24.5 cm\r\n\r\nPENGIRIMAN PATRIS :\r\n- Silahkan di klik BELI jika stok tersedia / Ready stock dan pilih sesuai VARIASI yang diinginkan, dan apabila karena satu dan lain hal kami tidak bisa mengirimkan tepat waktu, maka akan kami hubungi via CHAT\r\n- Pesanan yang telah diverfikasi sebelum jam 15.00 akan kami kirimkan di hari yang sama, jika lebih dari itu akan diproses sehari setelahnya (kecuali status pengiriman PO)\r\n- Proses pickup dan update resi dari ekspedisi berlangsung dari jam 17.00 - 24.00 WIB.\r\n- Patris tidak ada pengiriman setiap hari minggu dan tanggal merah, pesanan yang masuk pada hari minggu dan tanggal merah akan dikirimkan pada hari berikutnya.\r\n- Status pengiriman PO adalah untuk mengantisipasi banyaknya pesanan disesuaikan dengan kapasitas produksi kami.\r\n-Jika ada keluhan, produk yg diterima tidak sesuai, dsb silahkan hubungi Admin kami melalui chat. Sebelum memberikan penilaian silahkan hubungi Admin kami terlebih dahulu karena semua permasalahan kalian akan dibantu hingga selesai . Jadi kami harap bisa menerima review penilaian dan bintang yang baik.', 'Patris Official Store', 'https://images.tokopedia.net/img/cache/215-square/GAnVPX/2022/4/6/027010c9-6ab0-4819-b8b3-723977a08936.png'),
(64, 'KIVEE Kipas Angin Portable Mini Fan 1200 mAh Kipas 3-Speed Quiet USB', 'https://images.tokopedia.net/img/cache/200-square/VqbcmM/2023/6/27/66269172-4f0a-4e9e-834e-ff35932594e6.jpg', 'Rp.37.500', '💌Fitur Produk：\r\n①3-Speed:\r\n\r\n1-Speed sepoi-sepoi, bertiup saat tidur, angin sepoi-sepoi sejuk dan tidak berisik,\r\n\r\n2-Speed gigi angin sejuk, bekerja untuk menghilangkan panas pengap dan lebih fokus\r\n\r\n3-Speed hembusan luar ruangan, tidak takut berkeringat dan menghapus riasan\r\n\r\n②KIVEE, kipas mini 1200mah waktu penggunaan 3-5 jam, membuat Anda sejuk sepanjang musim panas.\r\n③kipas portabel Micro-USB yang dapat diisi ulang, kantor, kipas angin listrik tujuan umum luar ruangan,\r\n④ desain portabel yang indah, model ultra-tipis dan imut, warna unik.\r\n⑤Ukuran kecil, penyimpanan mudah Mungil, bawa dia kapan saja, di mana saja, dan tas kecilnya masih turun, jadi Anda tidak takut musim panas.\r\n⑥dukungan dasar yang dapat dilepas, dapat mendukung ponsel,\r\n\r\n\r\n🔋Model: KV-FA15 (merah muda, putih, merah muda)\r\nModel: kv-FA15 Handheld Fan\r\nBahan, ABS\r\nTiga penyesuaian gigi,\r\nBaterai: polimer 1200mAh,\r\nMendukung pengisian daya saat menggunakan:\r\nBerat bersih: 85g,\r\nUkuran produk: 179 * 75 * 47.5mm;\r\nPacking: kotak warna\r\nCHARGER : MICRO USB\r\n\r\n✅Ketentuan Garansi:\r\n1.Garansi hanya untuk kerusakan murni dari pabrik bukan kesalahan penggunaan.\r\n2.Harus ada bukti kartu garansi, invoice Shopee, packaging produk, dan kelengkapan produk.\r\n3.Produk masih dalam masa garansi.\r\n*Note: Hubungi customer service kami melalui layanan chat, untuk mengetahui prosedur klaim Retur atau Garansi lebih lanjut.\r\nKIVEE：Innovational For Life, Intelligent For Future JNE regular', 'Kivee Official Store', 'https://images.tokopedia.net/img/cache/215-square/shops-1/2019/8/14/6453264/6453264_d801f0bb-2c09-4fbf-a5e2-ec1230ed2d57.jpg'),
