(94, 'Lanyard Hanphone Love Heart - Lanyard Gantungan Panjang HP - Aksesori Tangan Chain Iphone Android', 'https://images.tokopedia.net/img/cache/200-square/VqbcmM/2024/5/12/adb3fc12-816b-45ae-8828-268f98c83fee.jpg', 'Rp14.000', 'Spesifikasi\r\nBahan: Akrilik\r\nUkuran Produk: Panjang: 20cm\r\n\r\nIsi Kemasan\r\n1 x Liontin Kasing Telepon\r\nTidak ada kotak ritel. Dikemas dengan aman di OPP Bag.\r\n\r\nCatatan:\r\nAda beberapa kecerdasan dalam nada warna gambar dan item yang sebenarnya.\r\nTolong tunggu 1-2mm berbeda karena pengukuran manual, terima kasih.', 'Tokonya Puan (Grosir)', 'https://images.tokopedia.net/img/cache/215-square/GAnVPX/2024/5/19/bf069abe-e3f6-483b-9969-926c719594d1.png');
